import React, { Component } from 'react'
import { useAlert } from 'react-alert'
import "./sign.css"

const alert = useAlert()

class SignPage extends Component {
	state = {
		username: '',
		password: '',
		repeatedPassword: '',
		emailAddress: '',
		firstName: '',
		lastName: ''
	}

	handleChange = (event) => {
		this.setState({[event.target.name]: event.target.value})
		if (event.target.name === 'repeatedPassword') {
			if (this.state.password !== this.state.repeatedPassword)
				console.log('error on passwords')
		}
	}

	handleSubmit = (event) => {
		console.log(this.state)
		var jsonBody = {
			'username': this.state.name,
			'password': this.state.password,
			'email': this.state.emailAddress,
			'firstname': this.state.firstName,
			'lastname': this.state.lastName
		}
		console.log(jsonBody)
		fetch('http://localhost:8080/users/' + event.target.target, {
			method: 'POST',
			headers: {
				'Content-type': 'application/json'
			},
			mode: 'cors',
			body: JSON.stringify(jsonBody)
		})
		.then(res => {
			//const propsCopy = this.props
			console.log('we are here')
			res.json()
			.then(jsonParsed => {
				console.log(jsonParsed)
			})
		})
		.then(error => {
			console.error(error)
		})
	}

	render() {
		return (
			<div className="login-wrap">
        <div className="login-html">
          <input readOnly id="tab-1" type="radio" name="tab" className="sign-in" checked/><label htmlFor="tab-1" className="tab">Sign In</label>
          <input readOnly id="tab-2" type="radio" name="tab" className="sign-up"/><label htmlFor="tab-2" className="tab">Sign Up</label>
        	<div className="login-form">
          	<div className="sign-in-htm">
	            <div className="group">
	              <label htmlFor="user" className="label">Username</label>
	              <input id="user" type="text" onChange={this.handleChange} name="name" className="input"/>
	            </div>
	            <div className="group">
	              <label htmlFor="pass" className="label">Password</label>
	              <input id="pass" type="password" onChange={this.handleChange} name="password" className="input" data-type="password"/>
	            </div>
	            {
	            //<div className="group">
	            //  <input id="check" type="checkbox" className="check" checked/>
	            //  <label htmlFor="check"><span className="icon"></span> Keep me Signed in</label>
	            //</div>
	            }
	            <div className="group">
	              <input type="submit" onClick={this.handleSubmit} target="authentication" className="button" value="Sign In"/>
	            </div>
	            <div className="hr">
	            </div>
	            <div className="foot-lnk">
	              <a href="#forgot">Forgot Password?</a>
	            </div>
          	</div>
						<div className="sign-up-htm">
							<div className="group">
								<label htmlFor="user" className="label">Username</label>
								<input id="user" type="text" onChange={this.handleChange} name="name" className="input"/>
							</div>
							<div className="group">
								<label htmlFor="pass" className="label">Password</label>
								<input id="pass" type="password" onChange={this.handleChange} name="password" className="input" data-type="password"/>
							</div>
							<div className="group">
								<label htmlFor="pass" className="label">Repeat Password</label>
								<input id="repeatPass" type="password" onChange={this.handleChange} name="repeatedPassword" className="input" data-type="password"/>
							</div>
							<div className="group">
								<label htmlFor="pass" className="label">Email Address</label>
								<input id="mail" type="text" onChange={this.handleChange} name="emailAddress" className="input"/>
							</div>
							<div className="group">
								<input type="submit" onClick={this.handleSubmit} target="register" className="button" value="Sign Up"/>
							</div>
							<div className="hr">
							</div>
							<div className="foot-lnk">
								<label htmlFor="tab-1">Already Member?</label>
							</div>
						</div>
			  	</div>
      	</div>
    	</div>
		)
	}
}

export default SignPage
